"use strict";
class CAsmStream {
    constructor(asm, offset = 0) {
        this._position = 0;
        this._mem = new Uint8Array(asm.memory.buffer);
        this._view = new DataView(this._mem.buffer, 0);
        this._startOffset = offset;
        this._size = 0;
    }
    get position() {
        return this._position;
    }
    set position(value) {
        this._position = value;
    }
    get view() {
        return this._view;
    }
    get size() {
        return this._size;
    }
    getRealPosition() {
        return this._startOffset + this._position;
    }
    first() {
        this._position = 0;
    }
    putString(value) {
        let bfStr = new TextEncoder().encode(value);
        this._view.setInt32(this.getRealPosition(), bfStr.byteLength, true);
        let tmp = this._position;
        this._position += 4;
        for (let n = 0; n < bfStr.byteLength; n++) {
            this._mem[this.getRealPosition()] = bfStr[n];
            this._position++;
        }
        this._size += bfStr.byteLength + 4;
    }
    getString() {
        let cnt = this._view.getInt32(this.getRealPosition(), true);
        this._position += 4;
        let bf = new Uint8Array(cnt);
        for (let n = 0; n < cnt; n++) {
            bf[n] = this._mem[this.getRealPosition()];
            this._position++;
        }
        return new TextDecoder("utf-8").decode(bf);
    }
    putInt8(value) {
        this._view.setInt8(this.getRealPosition(), value);
        this._position += 1;
        this._size += 1;
    }
    getInt8() {
        let val = this._view.getInt8(this.getRealPosition());
        this._position += 1;
        return val;
    }
    putInt16(value) {
        this._view.setInt16(this.getRealPosition(), value, true);
        this._position += 2;
        this._size += 2;
    }
    getInt16() {
        let val = this._view.getInt16(this.getRealPosition(), true);
        this._position += 2;
        return val;
    }
    putInt32(value) {
        this._view.setInt32(this.getRealPosition(), value, true);
        this._position += 4;
        this._size += 4;
    }
    getInt32() {
        let val = this._view.getInt32(this.getRealPosition(), true);
        this._position += 4;
        return val;
    }
    putNumber(value) {
        this._view.setFloat64(this.getRealPosition(), value, true);
        this._position += 8;
        this._size += 8;
    }
    getNumber() {
        let val = this._view.getFloat64(this.getRealPosition(), true);
        this._position += 8;
        return val;
    }
    putUInt8(value) {
        this._view.setUint8(this.getRealPosition(), value);
        this._position += 1;
        this._size += 1;
    }
    getUInt8() {
        let val = this._view.getUint8(this.getRealPosition());
        this._position += 1;
        return val;
    }
    putUInt16(value) {
        this._view.setUint16(this.getRealPosition(), value, true);
        this._position += 2;
        this._size += 2;
    }
    getUInt16() {
        let val = this._view.getUint16(this.getRealPosition(), true);
        this._position += 2;
        return val;
    }
    putUInt32(value) {
        this._view.setUint32(this.getRealPosition(), value, true);
        this._position += 4;
        this._size += 4;
    }
    getUInt32() {
        let val = this._view.getUint32(this.getRealPosition(), true);
        this._position += 4;
        return val;
    }
}
